import React, { Component } from "react";
import CarTable from './CarTable';

export default class ListAllCars extends Component 
{
    constructor(props) 
    {
        super(props)
        this.state = {
            cars: [{model:"avensis", colour:"red", year:2018, price:20000},
                {model:"yaris", colour:"blue", year:2010, price:1000},
                {model:"gallardo", colour:"yellow", year:2011, price:100000},
                {model:"Model X", colour:"black", year:2021, price:110000}]
        };                          
    }

    render() 
    {
        return (
                  <div className="table-container">
                    <CarTable cars={this.state.cars} />             
                  </div>
               );
    }
}
